import java.util.*;
public class Main {
	public static void main(final String[] args) {
        Scanner sc = new Scanner(System.in);
        long n = sc.nextInt();
        long a = sc.nextInt();
        long b = sc.nextInt();
        long num = (n / (a + b)) * a;
        long rem = n % (a + b);
        num += Math.max(a, rem);
        System.out.println(num);
    }
}

